'26L' Standortcode, der einen Standort oder ein geografisches Gebiet oder eine damit verbundene Gruppe solcher Standorte oder Gebiete kennzeichnet, die für eine damit verbundene Transaktion relevant sind und die einer der in (a) bis (f) unten definierten Strukturen entspricht:
a) zwei Großbuchstaben entsprechend dem ISO 3166-1 zwei Buchstaben Ländercode des Landes, in dem sich der/die Standort(e) oder das/die Gebiet(e) befindet/befinden oder aus dem/denen es/sie besteht/bestehen;
b) drei Großbuchstaben entsprechend dem IATA-Code des Flughafens oder der Stadt, in dem/denen sich der/die Standort(e) oder das/die Gebiet(e) befindet/befinden oder aus dem/denen es/sie besteht/bestehen;
c) vier oder mehr Zeichen, von denen die ersten drei einem ISO 3166-1 Ländercode entsprechen, gefolgt von einem Bindestrich (-), mit dem Rest als Postleitzahl in dem betreffenden Land;
d) vier oder mehr Zeichen, von denen die ersten drei einem ISO 3166-1 Ländercode entsprechen, gefolgt von einem Punkt (.), mit dem Rest als ISO 3166-2 Länderunterteilungscode in dem betreffenden Land;
e) fünf Großbuchstaben entsprechend dem UN/LOCODE des Gebiets, in dem sich der/die Standort(e) oder das/die Gebiet(e) befindet/befinden oder aus dem/denen es/sie besteht/bestehen;
f) die Verkettung, die nicht weniger als sieben oder mehr als 35 Zeichen lang ist, bestehend aus:
- einem ISO/IEC 15459 ausstellenden Agenturcode;
- einem Standortcode, bestehend aus Zeichen aus dem Satz {A-Z; 0-9}, der den Spezifikationen der betreffenden ausstellenden Agentur entspricht.

