UPU-Standortcode, der einen Standort oder ein geografisches Gebiet identifiziert, oder eine damit verbundene Gruppe solcher Standorte oder Gebiete, die für eine zugehörige Transaktion relevant sind und die mit einer der in a) bis g) unten definierten Strukturen übereinstimmen:
a) zwei Großbuchstaben, die dem ISO 3166-1-Zweibuchstaben-Ländercode des Landes entsprechen, in dem oder aus dem das/die Standort(e) oder Gebiet(e) sind;
b) drei Großbuchstaben, die dem IATA-Code des Flughafens oder der Stadt entsprechen, in, nahe oder bestehend aus dem/den Standort(en) oder Gebiet(en);
c) vier oder mehr Zeichen, von denen die ersten drei einem ISO 3166-1-Ländercode entsprechen, gefolgt von einem Bindestrich (-), mit dem Rest, der eine Postleitzahl des betreffenden Landes ist;
d) vier oder mehr Zeichen, von denen die ersten drei einem ISO 3166-1-Ländercode entsprechen, gefolgt von einem Punkt (.), mit dem Rest, der einem ISO 3166-2-Unterteilungscode des betreffenden Landes entspricht;
e) fünf Großbuchstaben, die dem UN/LOCODE des Gebiets entsprechen, in, nahe oder bestehend aus dem/den Standort(en) oder Gebiet(en);
f) sechs Großbuchstaben und alphanumerische Zeichen, die einem UPU IMPC-Code entsprechen, der gemäß UPU-Standard S34 zugewiesen wird;
g) die Verkettung, die nicht weniger als sieben oder mehr als 25 Zeichen lang ist, von:
 - einem von UPU-Standards S31 zugewiesenen Ausstellercode;
 - einem Standortcode, bestehend aus Zeichen aus dem Satz {A-Z; 0-9}, der den Spezifikationen des Ausstellers entspricht.

Kennzeichen-Platte mit Dienstdaten und Standortcode ist eine zusammengesetzte Datenkonstruktion, die den Spezifikationen des UPU-Standards S25 entspricht und die Spezifikation von:
 - einem ISO/IEC 15459-konformen Artikel-Identifikator enthält;
 - einer Datenidentifikator 5U-konformen Spezifikation des zu erbringenden Dienstes in Bezug auf den Artikel;
 - einem Datenidentifikator 17U-konformen UPU-Standortcode oder einem Datenidentifikator 18U-konformen qualifizierten UPU-Standortcode.
 Hinweis - Weitere Einzelheiten entnehmen Sie bitte dem UPU-Standard S25. Der Unterschied zwischen einem einfachen UPU-Standortcode (DI 17U) und einem qualifizierten UPU-Standortcode (DI 18U) kann aus dem ersten Zeichen bestimmt werden. Wenn dieses numerisch ist, gilt 18U; wenn es alphabetisch ist, gilt 17U.

