Datum, dargestellt in modifizierter UTC-konformer Form:
jjjj[mm[tt[hh[mm[ss[fff]]]]]][poooo], wobei eckige Klammern Optionen andeuten und jjjj das Jahr, mmdd der Monat und Tag, hhmmss die Tageszeit in Stunden, Minuten und Sekunden, fff die Bruchteile von Sekunden und poooo die Abweichung von UTC in Stunden und Minuten darstellt, wobei die Abweichung positiv ist, wenn p ein Punkt (.) ist, negativ, wenn P ein Minuszeichen (-) ist.
