Deklaration der Verpackungsmaterialkategorie*, Code* und Gewicht für ein bestimmtes Verpackungsmaterial, das in einer bestimmten Verpackung gemäß der EU-Verpackungs- und Verpackungsabfallrichtlinie verwendet wird. (Materialkategorie und -code definiert in Anhang M).
12ECCMMMMMMNNNNNUU, wobei: - '12E' (an3) der Datenidentifikator ist;
 - 'CC' (n2) die Materialkategorie gemäß Anhang M ist;
 - 'MMMMMM' (an1...6) der Materialcode gemäß Anhang M ist;
 - 'NNNNN' (n5) Materialgewicht, inklusive Dezimalpunkt (z.B. 12,12);
 - 'UU' (an2) die Maßeinheit für Gewicht ist (z.B. KG, GR, LB oder OZ nach ANSI X12.3 wie in Anhang D).

