Empfängernummer.
Die eindeutige Identifikationsnummer kann die IRS-, EIN-, SSN- oder die von CBP zugewiesene Nummer sein, wie auf der Sicherheitsakte erforderlich. Nur die folgenden Formate dürfen verwendet werden: IRS EIN: NN-NNNNNNN;
IRS EIN mit Suffix:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP zugewiesene Nr.: YYDDPP-NNNNN.
